export const getQuestionList = async (difficultyLevel) => {
  const endpoint = `https://opentdb.com/api.php?amount=10&difficulty=${difficultyLevel}`;
  const data = await (await fetch(endpoint)).json();
  return {
    type: "GET_QUESTIONS_LIST",
    payload: data,
  };
};
